import React from 'react';
import '../index.css'

const Home = () => {
    return(
        <div className='contain'>
            <h2>Documentation</h2>
            <p>This API allows you to get the acquire 
            information on top car dealerships in 
            Bay Area as well as each customer 
            information and their purchase order of 
            the car. All endpoints are under 
            localhost:9000/api/. Listed below are 
            the documentations and can be operated 
            using Postman Application.</p>   
        </div>

    )
}

export default Home;
